(function(VARIATION,PAGE,SHARED){
"use strict";var copies=[{"selector":"h1 + p span","newCopy":"Confluence Data Center is a self-hosted solution that improves communication within your enterprise DevOps teams and keeps information flowing."},{"selector":"section:nth-child(5) .block h3","newCopy":"Facilitate flow, uninterrupted"},{"selector":"section:nth-child(5) .block p","newCopy":"<p>Effective communication is vital to DevOps. When your team creates documents, provides feedback and iterates on work in Confluence, maintaining a constant flow of communication is mission-critical.</p><p>Downtime means lost productivity. Confluence Data Center's active-active clustering model allows you to collaborate around the clock without impacting performance.</p>"},{"selector":"section:nth-child(5) .block + h3","newCopy":"Scale without compromise"},{"selector":"section:nth-child(5) .block + h3 + p","newCopy":"Your teams rely on Confluence for many aspects of their work. As your team grows and collaborates on more work, you need a fast and simple way to scale. Add a node or tweak the load distribution across each node to ensure your team can collaborate at scale without compromising performance."},{"selector":"section:nth-child(5) img","newCopy":"//cdn.optimizely.com/img/1096093/fd715ba677294963821e185f90c905dc.png"},{"selector":"section:nth-child(6) img","newCopy":"//cdn.optimizely.com/img/1096093/8997609ff1ee46fdb6634f28e2724c8f.png"},{"selector":"section:nth-child(6) .block h3","newCopy":"Improve the feedback loop"},{"selector":"section:nth-child(6) .block p","newCopy":"Encouraging feedback is a key tenet of DevOps. Use Confluence to conduct post-incident reviews (PIRs), retrospectives, or health monitors to ensure feedback is transparent, focused and productive."},{"selector":"section:nth-child(6) .block + h3","newCopy":"Encourage experimentation"},{"selector":"section:nth-child(6) .block + h3 + p","newCopy":"Iterating and learning from failure are necessary to improving your DevOps practices. Use Confluence to easily create experiments, convey targets or goals, and evaluate results. And most importantly, Confluence supports DevOps culture by helping teams build trust, empathy, and respect as they work."},{"selector":"section:nth-child(7) h2","newCopy":"Collaborate across your enterprise team"},{"selector":"section:nth-child(7) h2 + p","newCopy":"Confluence Data Center is a self-hosted solution that scales and provides uninterrupted access, making it easier for enterprise DevOps teams to collaborate."},{"selector":"section:nth-child(7) .column:nth-child(2) h4","newCopy":"Active-active clustering"},{"selector":"section:nth-child(7) .column:nth-child(2) p","newCopy":"Cluster multiple active servers for uninterrupted access even in the event of a hardware failure."},{"selector":"section:nth-child(7) .column:nth-child(4) h4","newCopy":"Instantly increase capacity"},{"selector":"section:nth-child(7) .column:nth-child(4) p","newCopy":"Add nodes to instantly increase capacity for concurrent users without sacrificing performance."},{"selector":"section:nth-child(7) .column:nth-child(5) h4","newCopy":"Distributed load"},{"selector":"section:nth-child(7) .column:nth-child(5) p","newCopy":"Use your choice of a load balancer (software or hardware) to intelligently distribute load and improve performance."},{"selector":"section:nth-child(7) .column:nth-child(7) p","newCopy":"Teams can share drafts, create content together and give feedback in real-time to keep projects moving forward, faster."}];SHARED.changeCopy(copies);
})('v1','confluence-enterprise',window.CRO_SHARED_10382304183);
