(function(VARIATION,PAGE,SHARED){
"use strict";var copies=[{"selector":"h1","newCopy":"Git for Enterprise DevOps teams"},{"selector":"h1 + p","newCopy":"Bitbucket Data Center is a self-hosted solution that provides source code collaboration for DevOps teams of any size, across any distance"},{"selector":"section:nth-child(5) img","newCopy":"//cdn.optimizely.com/img/1096093/f0d460e12e13479ba971a44a3e408e5d.png"},{"selector":"section:nth-child(5) h2 + p","newCopy":"Bitbucket Data Center is the next generation Git self-hosted solution for DevOps teams. Adopt DevOps practices without forfeiting security, compliance or scale. Plus, maintain a secure, scalable development environment focused on improving speed, collaboration, and quality."},{"selector":"section:nth-child(5) h2 + p + p","newCopy":"Ensure consistent performance across distributed teams with active-active clustering, built-in smart mirroring, and disaster recovery. And boost security with granular permissions down to the branch level."},{"selector":"section:nth-child(7) p","newCopy":"<p>Stretch Git to support your team with smart mirroring, customizable pull request workflows, code search, or Git LFS (Large File Storage).</p><p>Distributed version control is vital part of DevOps. Bitbucket and Git make it easy to collaborate with your team, iterate often, and ship high quality code. Plus, it massively scales to support teams of all sizes.</p>"},{"selector":"section:nth-child(7) img","newCopy":"//cdn.optimizely.com/img/1096093/3afdc1c33f104bb5a47c0c387d0319be.png"},{"selector":"section:nth-child(9) p","newCopy":'<p>Work with the DevOps tools that help your team build better software. Integrations with Atlassian tools come out-of-the-box. Integrate with <a href="https://extranet.atlassian.com/www.atlassian.com/software/jira">Jira Software</a> to get instant, shared visibility of work in progress by connecting commits and pull requests.</p><p>Or select one of the hundreds of apps from the Atlassian <a href="https://marketplace.atlassian.com/search?hosting=dataCenter&product=bitbucket">Marketplace</a> to support your DevOps journey.</p>'},{"selector":"section:nth-child(13) h2","newCopy":"Grow Git at an Enterprise Scale"},{"selector":"section:nth-child(13) h2 + p","newCopy":"Bitbucket Data Center provides source code collaboration for DevOps teams of any size, across any distance."},{"selector":"section:nth-child(13) .column:nth-child(5) p","newCopy":"Share knowledge, discuss changes, and approve code reviews more efficiently with pull requests. Hold discussions in the source code with inline comments."},{"selector":"section:nth-child(13) .column:nth-child(3) p","newCopy":"Intelligently share load between nodes to avoid performance degradation and bolster concurrent user and build capacity."},{"selector":"section:nth-child(13) .column:nth-child(6) p","newCopy":'Monitor the status of your <a href="https://extranet.atlassian.com/www.atlassian.com/software/bamboo">Bamboo</a> builds and detect issues before they become a problem by linking to CI and tracking tools without impacting performance.'},{"selector":"section:nth-child(14)","newCopy":""}];SHARED.changeCopy(copies);
})('v1','bitbucket-enterprise',window.CRO_SHARED_10382304183);
