var utils = optimizely.get('utils');
var $toaster = $(extension.$html);
var $status_icon = $('.toaster__status-icon', $toaster);
var $open_state = $('.toaster--open-state', $toaster);
var $closed_state = $('.toaster--closed-state', $toaster);

var set_cookie = function CRO_set_cookie(name, value, optDays, domain) {
  var cookie = name + '=' + value;
  if (optDays) {
    var date = new Date();
    date.setTime(date.getTime() + optDays * 24 * 60 * 60 * 1000);
    cookie += '; expires=' + date.toGMTString();
  }
  if (domain) {
    cookie += '; domain=' + domain;
  }
  document.cookie = cookie + '; path=/';
};

utils.waitForElement('body').then(function (body) {
  // Prepend the extension html to the body
  var $body = $(body);
  $body.append($toaster);
});

// console.log(`[cro] extension.market_alias`, extension.market_alias);
if (extension.market_alias === 'true') {
  utils.waitUntil(function () {
    return window.optimizely.data.thirdParty.demandbase;
  }).then(function () {
    var demandbase = window.optimizely.data.thirdParty.demandbase;
    var company = "";

    if (demandbase.company_name) {
      company = demandbase.company_name;
      // use the shorter name, e.g. "Intel" instead of "Intel Corporation"
      if (demandbase.marketing_alias && demandbase.marketing_alias.length < company.length) {
        company = demandbase.marketing_alias;
      }
    }

    utils.waitForElement('.toaster__closed-state-headline-text').then(function (closed_headline) {
      var $closed_headline = $(closed_headline);
      var base_copy = $closed_headline.text().trim();
      var copy = base_copy;

      // If there's a company name, adjust the copy accordingly.
      if (company.length > 0) {
        copy = '<span class="name">' + company + '</span>, ' + copy.toLowerCase();
        $toaster.addClass("has-company-name");
      }

      $closed_headline.parent().attr("title", base_copy);
      $closed_headline.html(copy);
    });
  });
}

$('.toaster--launch', $toaster).click(function () {
  // slide toaster up/down based on open/closed status of the toaster
  if ($toaster.hasClass('toaster--initial')) {
    $toaster.removeClass('toaster--initial');
    $toaster.addClass('toaster--slideup');

    // If we have a cookie name set in the config, then set that cookie to true.
    if (extension.cookie_name) set_cookie(extension.cookie_name, "true", 365);
  } else {
    $toaster.removeClass('toaster--slideup');
    $toaster.addClass('toaster--initial');
  }
  // rotate 'x' based on open/closed status of the toaster
  if ($status_icon.hasClass('toaster--rotation')) {
    $status_icon.addClass('toaster--no-rotation');
    $status_icon.removeClass('toaster--rotation');

    // fire toaster closed goal
    window['optimizely'] = window['optimizely'] || [];
    window['optimizely'].push({
      type: "event",
      eventName: "toaster-closed"
    });
  } else {
    $status_icon.addClass('toaster--rotation');
    $status_icon.removeClass('toaster-no-rotation');

    // fire toaster opened goal
    window['optimizely'] = window['optimizely'] || [];
    window['optimizely'].push({
      type: "event",
      eventName: "toaster-opened"
    });
  }
  // hide and unhide content based on open/closed
  // status of the toaster
  if ($open_state.hasClass('toaster--hidden')) {
    $open_state.removeClass('toaster--hidden');
    $closed_state.addClass('toaster--hidden');
  } else {
    $closed_state.removeClass('toaster--hidden');
    $open_state.addClass('toaster--hidden');
  }
});

$('.toaster__cta', $toaster).click(function () {
  window['optimizely'] = window['optimizely'] || [];
  window['optimizely'].push({
    type: "event",
    eventName: "toaster-cta-clicked"
  });
});
